function sum(a, b) {
  let sum = a + b;
  return sum;
}
function sub(a, b) {
  let sub = a - b;
  return sub;
}
function mult(a, b) {
  let mult = a * b;
  return mult;
}
function division(a, b) {
  let division = a / b;
  return division;
}

export { sum, sub, mult, division };
